import React , {useEffect , useState} from 'react'
import axios from 'axios'

function App() {

  useEffect(()=>{
    axios.get(`https://www.swiggy.com/dapi/restaurants/list/v5?lat=17.37240&lng=78.43780&is-seo-homepage-enabled=true&page_type=DESKTOP_WEB_LISTING`)
    .then((res)=>{
      console.log(res.data.data.cards)
    })

  },[])
  return (
    <div>App</div>
  )
}

export default App
